'''La Salle College-Victorias''' (formerly ''University of St. La Salle-Vicmico'') is a private school in [[Victorias City]], [[Negros Occidental]],<ref>http://philippinecollegecourses.com/western-visayas/negros-occidental/la-salle-college-victorias.html</ref> <ref>http://www.philippinecompanies.com/companyprofile/54629/la-salle-college-victorias</ref> [[De La Salle Supervised Schools | supervised]] by the [[University of St. La Salle]].

